import './App.css';
import React from 'react';
import Navbar from './components/Navbar';
import Home from './components/Home';
import Contact from './components/Contact'
import { Routes , Route} from 'react-router-dom';


function App() {
  return (
    <>
      <Navbar />
      <Routes>
        <Route path='' exact>
          <Home />
          <Contact />
        </Route> 
      </Routes>
    </>
  );
}

export default App;
